import React, { useState, useEffect } from "react";
import "./App.css";
import io from "socket.io-client";

const socket = io("http://localhost:5000");

const App = () => {
  const [config, setConfig] = useState({
    totalTickets: "",
    releaseRate: "",
    retrievalRate: "",
    maxCapacity: "",
  });

  const [ticketData, setTicketData] = useState({
    totalTickets: 0,
    maxTickets: 0,
    sellingTickets: 0,
    remainingTickets: 0,
  });

  const [isRunning, setIsRunning] = useState(false);

  useEffect(() => {
    socket.on("updateTickets", (data) => {
      setTicketData((prev) => ({
        ...prev,
        sellingTickets: data.sellingTickets,
        remainingTickets: data.remainingTickets,
      }));
    });

    socket.on("error", (msg) => {
      alert(msg);
    });

    return () => socket.disconnect();
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setConfig((prev) => ({ ...prev, [name]: value }));
  };

  const handleSave = () => {
    setTicketData((prev) => ({
      ...prev,
      totalTickets: config.totalTickets,
      maxTickets: config.maxCapacity,
      remainingTickets: config.totalTickets,
    }));
    alert("Configuration saved!");
  };

  const handleClose = () => {
    setConfig({ totalTickets: "", releaseRate: "", retrievalRate: "", maxCapacity: "" });
    alert("Configuration cleared!");
  };

  const handleStart = () => {
    if (!config.totalTickets || !config.maxCapacity) {
      alert("Please save a valid configuration before starting.");
      return;
    }
    setIsRunning(true);
    socket.emit("start", config);
  };

  const handleStop = () => {
    setIsRunning(false);
    socket.emit("stop");
  };

  const handleReset = () => {
    setIsRunning(false);
    setTicketData({
      totalTickets: 0,
      maxTickets: 0,
      sellingTickets: 0,
      remainingTickets: 0,
    });
    socket.emit("reset");
  };

  return (
    <div className="app">
      <header className="header">
        <h1>Ticket Management System</h1>
      </header>

      <div className="main-content">
        {/* Configuration Details */}
        <div className="box config-box">
          <h2>Configuration Details</h2>
          <form>
            <label>
              Total Number of Tickets:
              <input
                type="number"
                name="totalTickets"
                value={config.totalTickets}
                onChange={handleInputChange}
              />
            </label>
            <label>
              Ticket Release Rate:
              <input
                type="number"
                name="releaseRate"
                value={config.releaseRate}
                onChange={handleInputChange}
              />
            </label>
            <label>
              Customer Retrieval Rate:
              <input
                type="number"
                name="retrievalRate"
                value={config.retrievalRate}
                onChange={handleInputChange}
              />
            </label>
            <label>
              Maximum Ticket Capacity:
              <input
                type="number"
                name="maxCapacity"
                value={config.maxCapacity}
                onChange={handleInputChange}
              />
            </label>
            <div className="button-group">
              <button type="button" onClick={handleSave}>
                Save
              </button>
              <button type="button" onClick={handleClose}>
                Close
              </button>
            </div>
          </form>
        </div>

        {/* Ticket Pool Status */}
        <div className="box status-box">
          <h2>Ticket Pool Status</h2>
          <p>Total Tickets: {config.totalTickets}</p>
          <p>Release Rate: {config.releaseRate} tickets/sec</p>
          <p>Retrieval Rate: {config.retrievalRate} tickets/sec</p>
          <p>Max Capacity: {config.maxCapacity}</p>
        </div>

        {/* Control Panel */}
        <div className="box control-panel">
          <h2>Control Panel</h2>
          <button onClick={handleStart} disabled={isRunning}>
            Start
          </button>
          <button onClick={handleStop} disabled={!isRunning}>
            Stop
          </button>
          <button onClick={handleReset}>Reset</button>
        </div>
      </div>

      {/* Real-Time Ticket Selling Details */}
      <div className="box selling-details">
        <h2>Real-Time Ticket Selling Details</h2>
        <p>Total Tickets: {ticketData.totalTickets}</p>
        <p>Maximum Tickets: {ticketData.maxTickets}</p>
        <p>Selling Tickets: {ticketData.sellingTickets}</p>
        <p>Remaining Tickets: {ticketData.remainingTickets}</p>
      </div>

      <footer className="footer">
        <p>&copy; 2024 Ticket Management System</p>
      </footer>
    </div>
  );
};

export default App;
